<script>
    "use strict";
    window.onload = function init() {
        var openMenuBtn = document.querySelector('#open-menu');
        var closeMenuBtn = document.querySelector('#close-menu');
        var eventsConfig = { passive: true };

        openMenuBtn.addEventListener('click', toggleMenu, eventsConfig);
        closeMenuBtn.addEventListener('click', toggleMenu, eventsConfig);

        function toggleMenu() {
            var menuWrap = document.querySelector('#mobile-menu-overlay');
            var classes = Array.from(menuWrap.classList);

            if (classes.includes('menu-hidden')) {
                menuWrap.classList.remove('menu-hidden');
            } else {
                menuWrap.classList.add('menu-hidden');
            }
        }
    };
</script>
